class DisplayType extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render(){
    const {cardDeck} = this.props;
    const picArray = cardDeck.map(({type})=> 
    <img src="./images/${type}.png" alt={type}/>
    )
    return(picArray)
  }


}

export default DisplayType;
